  return (
    <div style={{ marginRight: "-24px", marginLeft: "-24px" }}>
      <Grid container spacing={3}>
        {connections.map((item) => (
          <Grid item xs={4}>
            <UserCard userInfo={item}/>
          </Grid>
        ))}
      </Grid>
    </div>
  );
};

